var TabManager={initialize:function(d){var c=d;var g=c.innerHeight();if(g>=50){while(g>50){var b=c.children("li:not(:last-child)");var f=b.length;var e=$(b[f-1]);var a='<a class="dropdown-item" href="'+e.children("a").attr("href")+'" data-toggle="tab">'+e.text()+"</a>";c.find(".collapsed-tabs").prepend(a);e.remove();g=c.innerHeight()}}else{var f=0;while(g<50&&(c.children("li").length>0)&&f++<20){var h=c.find(".collapsed-tabs").children("a");var f=h.length;if(f){var e=$(h[0]);var a="<li class='nav-item'>\n<a href='"+e.attr("href")+"' data-toggle='tab'>"+e.text()+"</a>\n</li>";c.children("li.collapsed-menu").before(a);e.remove();g=c.innerHeight()}else{break}}if(g>50){TabManager.initialize(d)}}if(!c.find(".collapsed-tabs").children("a").length){c.find(".collapsed-menu").addClass("hidden");c.find(".collapsed-menu").hide()}else{c.find(".collapsed-menu").removeClass("hidden");c.find(".collapsed-menu").show()}}};$(function(){TabManager.initialize($(".nav-tabs-responsive"));$(window).resize(function(){TabManager.initialize($(".nav-tabs-responsive"))})});